import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Offcanvas from 'react-bootstrap/Offcanvas';

function OffcanvasExample() {
  return (
    <>
      {['sm'].map((expand) => (
        <Navbar key={expand}  expand={expand} className="mb-3" style={{ height: "3rem", backgroundColor: "black" }}>
          <Container fluid>
            <Navbar.Brand ></Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
           
              <Nav
                className="mx-auto"
                style={{
                  fontSize: "0.85rem",
                  fontFamily: "FuturaPT,Arial,sans-serif",
                }}
              >
                <Nav.Link className=" mx-2" href="/Watercolour">
                  WATERCOLOUR
                </Nav.Link>
                <Nav.Link className=" mx-2" href="/Pencil">
                  PENCIL
                </Nav.Link>
                <Nav.Link className=" mx-2" href="/Acrylic">
                  ACRYLIC
                </Nav.Link>
                <Nav.Link className=" mx-2" href="/Oil">
                  OIL
                </Nav.Link>
                <Nav.Link className=" mx-2" href="/Guides">
                  GUIDES
                </Nav.Link>
                <Nav.Link className=" mx-2" href="/Sketchbooks">
                  SKETCHBOOKS
                </Nav.Link>
                <Nav.Link className=" mx-2" href="/Prints">
                  PRINTS
                </Nav.Link>
              </Nav>
                
                
              
          </Container>
        </Navbar>
      ))}
    </>
  );
}

export default OffcanvasExample;
